import React, { Component } from 'react';

class CalenderComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
            weeks: ['日', '月', '火', '水', '木', '金', '土']
        }
    }
    render() {
        return (
            <table>
                <tr>
                    {this.state.weeks.map(day =>
                        <td>{day}</td>)}
                </tr>
                <td>
                    date:??
            </td>
                <Day />
                {this.props.nowdate}
            </table>
        )
    }
}

class Day extends Component {

    render() {
        return (
            <div onClick={this.onClickcom}>tes</div>
        );
    }
    onClickcom() {
        alert("test");
    }
}
export default CalenderComponent;
